export const Icon = (
    {
      name,
      active,
    },
) => {
  let result;
  switch (name) {
    case 'flat':
      result = (
        <Flat/>
      );
      break;
    case 'house':
      result = (
        <House/>
      );
      break;
    case 'dacha':
      result = (
        <Dacha/>
      );
      break;
    case 'land':
      result = (
        <Land/>
      );
      break;
    case 'shed':
      result = (
        <Shed/>
      );
      break;
    case 'room':
      result = (
        <Room/>
      );
      break;
    case 'commercial':
      result = (
        <Commercial/>
      );
      break;
    case 'construction-market':
      result = (
        <Market/>
      );
      break;
    case 'add':
      result = (
        <Add hover={active}/>
      );
      break;
    default:
      result = null;
  }
  return result;
};
